import React, { Fragment } from 'react';
import Breadcrumb from '../../layout/breadcrumb'
import { Container, Row, Col, Card, CardHeader, CardBody } from 'reactstrap'
import CountUp from 'react-countup';
import DataTable from 'react-data-table-component'
import { supportData, supportColumns } from '../../data/supportdb';
import {Order,Done,Cancel,Pending,Profit,Loss,Running,Smooth} from '../../constant'

const ManageProjects = () => {
    return (
        <Fragment>
            <Breadcrumb parent="Dashboard" title="Ticket Prediction" />
            <Container fluid={true}>
                <Row>
                    <Col sm="12">
                        <Card>
                            <CardHeader>
                                <h5>{"LIve Ticket Prediction"}</h5>
                                <span>{""}</span>
                            </CardHeader>
                            <CardBody>
                                <Row>

                                </Row>
                                <div className="table-responsive support-table">
                                    <DataTable
                                        columns={supportColumns}
                                        data={supportData}
                                        striped={true}
                                        center={true}
                                        pagination
                                    />
                                </div>
                            </CardBody>
                        </Card>
                    </Col>
                </Row>
            </Container>
        </Fragment>
    );
};

export default ManageProjects;
